import React from 'react';
import './SwipeButtons.css';
import ReplayIcon from '@material-ui/icons/Replay'; // Example icons from Material-UI
import CloseIcon from '@material-ui/icons/Close';
import FavoriteIcon from '@material-ui/icons/Favorite';

const SwipeButtons = () => {
  return (
    <div className="SwipeButtons">
      <div className="SwipeButtons__Button SwipeButtons__Repeat">
        <ReplayIcon fontSize="large" />
      </div>
      <div className="SwipeButtons__Button SwipeButtons__Left">
        <CloseIcon fontSize="large" />
      </div>
      <div className="SwipeButtons__Button SwipeButtons__Right">
        <FavoriteIcon fontSize="large" />
      </div>
    </div>
  );
};

export default SwipeButtons;
